    });

    // Create objs
    this._name = name;
    this._length = length;
    this._students = students;
  }

  // Setters
  set name(newName) {
    if (Object.getPrototypeOf(newName) !== String.prototype) throw TypeError('name must be a string');
    this._name = newName;
  }

  set length(newLen) {
